{"data": [{"created_time": "2022-10-08T21:44:28+0000", "message": "Y donde se saca. Yo tengo el permiso temporal aun así tengo que sacarla"}, {"created_time": "2022-10-08T21:45:15+0000", "message": "Yo pienso ir ha Venezuela pronto"}, {"created_time": "2022-10-08T22:44:17+0000", "message": "Hola pero con el PPT puedo irá Venezuela y regresarme"}, {"created_time": "2022-10-08T23:51:21+0000", "message": "https://elestimulo.com/de-interes/2022-10-08/estos-son-los-nuevos-requisitos-para-transitar-entre-colombia-y-venezuela/"}, {"created_time": "2022-10-08T23:55:00+0000", "message": "El nuevo director de Migración Colombia, Carlos Fernando García, anunció el viernes 7 de octubre un cambio de los requisitos en el tránsito entre ambos países para mejorar la migración pendular.

¿Cuáles son los requisitos?

«Hemos tomado la decisión de que a partir de hoy solo se solicitará uno de los tres documentos que se estaban solicitando a la hora de ingresar a territorio colombiano, que son la cédula venezolana, el pasaporte o la Tarjeta de Movilidad Fronteriza (TMF)», dijo García a periodistas."}, {"created_time": "2022-10-09T00:00:55+0000", "message": "https://www.laopinion.com.co/frontera/solo-con-cedula-de-identidad-pueden-pasar-los-venezolanos-colombia"}, {"created_time": "2022-10-09T15:08:23+0000", "message": "Buenos días.. con el ppt puedo viajar en avión desde Colombia a Venezuela?"}, {"created_time": "2022-10-10T00:27:24+0000", "message": "Hola buenas tarde  yo toda via espero mi PPT y eso que tengo PeP hace un año y nada"}, {"created_time": "2022-10-10T03:29:05+0000", "message": "Carnet fronterizo será?"}, {"created_time": "2022-11-05T18:45:28+0000", "message": "Hola buenas tarde  una pregunta  me mandaron a repetir el biometrico  estoy en bogota por favor me pueden orientar donde sacarlo de nuevo"}], "paging": {"cursors": {"before": "WTI5dGJXVnVkRjlqZAFhKemIzSTZANek14T0RRME9UTXlOVEE1T0RFMk16b3hOalkxTWpZAMU5EWTUZD", "after": "WTI5dGJXVnVkRjlqZAFhKemIzSTZAOREl6TnpreU5ETXpNRGt5TWpjeU9qRTJOamMyTnpNNU1qaz0ZD"}}}

{"data": [{"created_time": "2022-09-08T23:31:28+0000", "from": {"name": "Voices of Venezuela", "id": "319662435565899"}, "message": "Puede contactar al organismo de migración Colombia desde su mensajería privada de la red social de Facebook para una atención personalizada sobres su caso👉https://www.facebook.com/MigracionCol"}, {"created_time": "2022-09-08T23:44:44+0000", "from": {"name": "Voices of Venezuela", "id": "319662435565899"}, "message": "comunícate con Migración Colombia mediante este correo: servicio.ciudadano@migracioncolombia.gov.co o llamando a la oficina más cercana de tu localidad, también puedes hacer el reporte aquí 

https://apps.migracioncolombia.gov.co/centrovirtual/interna/formularioPQRSPEP.php

👆Con el derecho a petición desde el formulario creado por el organismo de migración, Colombia pueden notificarle cualquier preocupación en cuanto el tiempo de ausencia del documento al enviar le está notificando sobre su caso particular."}, {"created_time": "2022-09-08T23:47:46+0000", "from": {"name": "Voices of Venezuela", "id": "319662435565899"}, "message": "Tienes 3 opciones realizar el derecho  a petición para enviarle un reporte al organismo sobre la situación de tu casa en particular. Contactar  un agente autorizado de migración Colombia para la exploración y hallazgos investigativos sobre tu caso y si existe alguna inconsistencia en tu proceso para proceder, o dirigirte a un punto visible para obtener preguntar acertadas que logren generar la calma que necesitas. El PPT será entregado a todos los migrantes que ejecutaron su proceso de forma efectiva al protocolo debes seguir consultando el estado de su PPT."}, {"created_time": "2022-09-16T01:42:54+0000", "message": "Una pregunta ya está abierto el consulado venezolano de bucaramanga ?"}, {"created_time": "2022-09-12T12:29:07+0000", "message": "Inf para los de septiembre"}, {"created_time": "2022-09-10T20:04:43+0000", "message": "Cuando abra entregan masiva en cartagena"}, {"created_time": "2022-09-09T20:20:37+0000", "message": "Hola soy de Cali y a mi hijo no le ha salido donde se puede registrar para saber si ya están listos"}, {"created_time": "2022-09-09T13:54:05+0000", "message": "Para que carajos sirve ese permiso?"}, {"created_time": "2022-09-09T10:22:17+0000", "message": "Holaaaaa"}, {"created_time": "2022-09-09T10:17:10+0000", "message": "Que tengan un feliz y bendecido día 🙏🙏🙏🙏"}, {"created_time": "2022-09-09T10:16:48+0000", "message": "Que pasaran con los pasaportes vencidos y los PPT que no han sido retirados y tienen ya más de tres meses en bodega buen día !!!"}, {"created_time": "2022-09-09T04:51:22+0000", "message": "Todavia se puede sacar ese permiso"}, {"created_time": "2022-09-09T03:01:06+0000", "message": "Como así? Mi hermana le sale su PPT impreso en Bogotá y ha ido a buscarlo varias veces y no  aparece por ningún lado que debe hacer para saber donde tiene que reclamarlo"}, {"created_time": "2022-09-09T02:12:41+0000", "message": "Hoy llame y me dijeron que debo tener paciencia que el hecho que diga impreso no quiere decir que esté listo. y dice impreso desde abril"}, {"created_time": "2022-09-09T02:06:10+0000", "message": "Yo fui al cade de manita y me quitaron mi número de celular por qué el número que aparece en el rum me lo robaron"}, {"created_time": "2022-09-09T02:03:39+0000", "message": "❤️"}, {"created_time": "2022-09-09T02:03:06+0000", "message": "Y como se hace para los q dicen impreso y no le sale dirección ni fecha de entrega"}, {"created_time": "2022-09-09T02:00:46+0000", "message": "Yo estoy en Bogotá"}, {"created_time": "2022-09-09T01:53:41+0000", "message": "Mi tlf me lo robaron"}, {"created_time": "2022-09-09T01:53:20+0000", "message": "Hola mi PPT aparece inpreso desdé hace 4 meses"}, {"created_time": "2022-09-09T01:52:09+0000", "message": "Hola y para los que aparecen impresos pero aun no nos dicen donde retirar?"}, {"created_time": "2022-09-09T01:42:06+0000", "message": "buenas noches quisiera saber con respeto a los ppt a dice impreso y no sale ligar de entrega, tengo un familiar q lo tiene así desde los primero días de junio.... Q incluso se pudo validar y inscribirse en la eps.."}, {"created_time": "2022-09-09T01:33:09+0000", "message": "Hola nani mi hijo hizo el registro y biometrico en Barranquilla y le sale en Bucaramanga hice el cambio y nadaaaa"}, {"created_time": "2022-09-09T01:14:19+0000", "message": "Nani yo soy de septiembre y nada ya está aprobado impreso pero nada que me lo entregan estoy en Barranquilla y en migración son muy poco amables solo dicen no está siga esperando"}, {"created_time": "2022-09-09T00:50:16+0000", "message": "Yo esperando q den mío sin errores otros q ni tiempo da irlos buscar"}], "paging": {"next": "https://graph.facebook.com/v13.0/319662435565899_607594167732820/comments?access_token=EAABj9aBk8VwBAF4ZBfwfoVLoLLmxb6et7VtfDKUXZCSM1ZANLYH9fNZBB7eyjR0F5owZA5f0UZCbNdzxcskl3Q9Fz3ksyJvHejD07JLFPOkaS9hftLNZBI78KdWqBl2NV5JE7Iwgn9cZAQgLAju5DmDBfFcW7Ktvnqfw6QZBBF0kvowZDZD&limit=25&after"}}
